import React from 'react';
import {Grid} from "@material-ui/core";

function Navbar() {
  return (
    <div>
        <div className={"navbar_barContent"}>
            <Grid container>
                <Grid item xs={2}>
                    aaaa
                </Grid>
                <Grid item xs={6}>
                    bbbb
                </Grid>
                <Grid item xs={4}>
                    ccccc
                </Grid>
            </Grid>
        </div>

    </div>
  );
};

export default Navbar;
